schemaDefinition: "create or replace view ENTITLEMENT(\n\t\"EntitlementContactLineItemSysID\"\
  ,\n\t\"EntitlementContractLineItem\",\n\t\"EntitlementSysID\",\n\t\"EntitlementNumber\"\
  ,\n\t\"EntitlementSupportModel\",\n\t\"EntitlementStartDate\",\n\t\"EntitlementEndDate\"\
  ,\n\t\"EntitlementIsValid\",\n\t\"EntitlementSyncedToHI\",\n\t\"EntitlementHISyncStatus\"\
  ,\n\t\"EntitlementContractInstance\",\n\t\"EntitlementUpdatedOn\",\n\t\"EntitlementContractSysID\"\
  ,\n\t\"EntitlementProductPrice\",\n\t\"EntitlementCreatedOn\"\n) as -- SEMANTIC\
  \ LAYER BEGINS\n\nSELECT \"U_CONTRACT_LINE_ITEM\" as \"EntitlementContactLineItemSysID\"\
  ,\n       \"DV_U_CONTRACT_LINE_ITEM\" as \"EntitlementContractLineItem\",\n    \
  \   \"SYS_ID\" as \"EntitlementSysID\",\n       \"U_NUMBER\" as \"EntitlementNumber\"\
  ,\n       \"U_SUPPORT_MODEL\" as \"EntitlementSupportModel\",\n       \"U_START_DATE\"\
  \ as \"EntitlementStartDate\",\n       \"U_END_DATE\" as \"EntitlementEndDate\"\
  ,\n       \"U_IS_VALID\" as \"EntitlementIsValid\",\n       \"U_SYNCED_TO_HI\" as\
  \ \"EntitlementSyncedToHI\",\n       \"DV_U_HI_SYNC_STATUS\" as \"EntitlementHISyncStatus\"\
  ,\n       \"DV_U_CONTRACT_INSTANCE\" as \"EntitlementContractInstance\",\n     \
  \  \"SYS_UPDATED_ON\" as \"EntitlementUpdatedOn\",\n       \"U_CONTRACT\" as \"\
  EntitlementContractSysID\",\n       \"DV_U_PRODUCT_PRICE\" as \"EntitlementProductPrice\"\
  ,\n       \"SYS_CREATED_ON\" as \"EntitlementCreatedOn\"\nFROM \"RDS\".\"SURF\"\
  .\"U_ENTITLEMENT\";"
